    "pea-island-national-wildlife-refuge-narrative-report-january-1-to-december-31-1968",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Pea Island
    NWR outlines Refuge accomplishments during the 1968 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, furbearers, raptors, fish, and diseases- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    collections and receipts, vegetation control, and prescribed burning. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, and safety. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
